import Link from 'next/link'
import Head from 'next/head'
import Router from 'next/router'

export default function MainLAyout() {

    const openNav=()=> {
        document.getElementById("mySidenav").style.width = "250px";
        document.getElementById("main").style.marginLeft = "250px";
      }
      
    const closeNav=()=> {
        document.getElementById("mySidenav").style.width = "0";
        document.getElementById("main").style.marginLeft= "0";
      }
  return (

    <>
    <div className="container">
        <Head>
            <title>Create Next App</title>
            <link rel="icon" href="/favicon.ico" />
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"></link>
            <link rel="stylesheet"href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css"/>
            <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
            <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.16.0/umd/popper.min.js"></script>
            <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/js/bootstrap.min.js"></script>
        </Head>

        

            <div id="mySidenav" class="sidenav">
                <a href="javascript:void(0)" class="closebtn" onclick="closeNav()">&times;</a>
                <a href="#">About</a>
                <a href="#">Services</a>
                <a href="#">Clients</a>
                <a href="#">Contact</a>
            </div>
            
            <div id="main">
                <span style="font-size:30px;cursor:pointer" onclick="openNav()">&#9776;</span>
            </div>
            
            
    
      
            {/* main part settings */}

            <div className="col-sm-9">
                <h1 className="settingHead">Settings</h1>
                <div className="row rowTop">  
                    <div className="col-sm-3 settingText">Status</div>
                    <div className="col-sm-9">Active</div>
                </div>

                <div className="row rowTop">  
                    <div className="col-sm-3 settingText">Название</div>
                    <input className="form-control col-sm-9" type="text" placeholder="Default input"/>
                </div>

                
                <div className="row rowTop">
                    <div className="col-sm-3 settingText">Telegram-токен бота</div>
                    <input className="form-control col-sm-9" type="text" placeholder="Default input"/>  
                </div>
                <div className="row rowTop">
                    <div className="col-sm-3 settingText">Язык</div>
                    
                        <select class="form-control" id="exampleFormControlSelect1">
                            <option>1</option>
                            <option>2</option>
                            <option>3</option>
                            <option>4</option>
                            <option>5</option>
                        </select>   
                </div>
                <div className="row rowTop">  
                    <div className="col-sm-3 settingText">Описание</div>
                    <textarea class="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
                </div>
                <div className="row rowTop">  
                    <div className="col-sm-3 settingText">Приветствие</div>
                    <textarea class="form-control" id="exampleFormControlTextarea1" rows="3" placeholder="Welcme!"></textarea>
                </div>


                
            </div>


        <style jsx global>{`
            .container {
            left:0;
            position:relative;
            padding:0;
            margin:0;
            }
            .sidenav {
                height: 100%;
                width: 0;
                position: fixed;
                z-index: 1;
                top: 0;
                left: 0;
                background-color: #111;
                overflow-x: hidden;
                transition: 0.5s;
                padding-top: 60px;
              }
              
              .sidenav a {
                padding: 8px 8px 8px 32px;
                text-decoration: none;
                font-size: 25px;
                color: #818181;
                display: block;
                transition: 0.3s;
              }
              
              .sidenav a:hover {
                color: #f1f1f1;
              }
              
              .sidenav .closebtn {
                position: absolute;
                top: 0;
                right: 25px;
                font-size: 36px;
                margin-left: 50px;
              }
              
              #main {
                transition: margin-left .5s;
                padding: 16px;
              }
              
              @media screen and (max-height: 450px) {
                .sidenav {padding-top: 15px;}
                .sidenav a {font-size: 18px;}
              }


            // main part settings 
            .settingHead{
                margin-top:20px;
                font-size:40px;
                font-weight:400;
            }
            .rowTop{
                margin-top:20px;
                
            }
            .settingText{
                font-weight:600;
                font-size:l6;
                margin-top:auto;
                margin-bottom:auto; 
            }
        `}</style>

        <style jsx global>{`
            html,
            body {
            padding: 0;
            margin: 0;
            font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
                Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
                sans-serif;
            }

            * {
            box-sizing: border-box;
            }
        `}</style>
    </div>
    </>
  )
}
